  \"Graded Density Carbon Bonded Carbon Fiber (CBCF) Preforms for Lightweight Ablative
  Thermal Protection Systems (TPS) Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  13,\n\t\t\"recent\": 4\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T03:34:37.871374\",\n\t\"name\": \"graded-density-carbon-bonded-carbon-fiber-cbcf-preforms-for-lightweight-ablative-thermal-p\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"FMI has developed graded density CBCF preforms
  for graded density phenolic impregnated carbon ablator (PICA) material to meet NASA's
  future exploration mission requirements for higher performance ablative TPS.  Graded
  Preform PICA (GPP) will be achieved by the continued development of lightweight,
  graded density carbon preforms which will decrease the overall areal mass of the
  resulting TPS material while enhancing its thermal performance capability.  The
  preform material designed to achieve this goal is comprised of a more mechanically
  robust, ablating outer layer and a lower weight, lower thermal conductivity inner
  layer than state-of-the-art PICA material. The ablative outer layer and thermal
  inner layer will be integrated in a continuously cast, monolithic material with
  equivalent capability for resin impregnation and conversion to PICA as the baseline
  existing preform material (FiberForm&amp;#174;).  During the proposed Phase II program,
  FMI will continue to develop its capability to produce graded density preform material
  to achieve TPS areal mass reductions estimated between 17-25&#37; relative to PICA
  with the goal of improving ablation performance. The developed preform materials
  will be converted to GPP and then characterized mechanically, thermally, and tested
  for ablation performance.  In addition to providing a pathway for these enhancements
  to tile acreage PICA TPS ablator material, FMI will incorporate the developed processing
  methodology to produce near net-shaped cast PICA TPS material preforms with a reduced
  density gradient compared to baseline manufacturing techniques.\",\n\t\"license_title\":
